INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("春咲 ひより", 1, 0, 1, "お！\nあそこに困ってそうな人発見！", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 0, 1.4, 1001, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("草野 優衣", 1, 0, 1, "大切な人を\n守れるようになりたい…って", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "みんなみたいに\nわたしも強くならなきゃ", 2, 0, 1.4, 1002, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("士条 怜", 1, 0, 1, "キミに必要な集中力と感性が", 0, "少しは磨かれると思いますよ。", 0, "フェンシングを始めてみては？", 2, 0, 1.4, 1003, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("穂高 みそぎ", 1, 0, 1, "今日はなにして遊ぶ？", 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "ねぇ、にいちゃん！", 2, 0, 1.5, 1004, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮 あかり", 1, 0, 1, "ねぇ…", 0, "私といっしょに…\nいかない？", 0, "風宮あかりです", 2, 0, 1.4, 1006, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("出雲 宮子", 1, 0, 1, "プリンたべたいのー", 0, "食べ物の恨みは怖いのー", 0, "出雲宮子なのー", 2, 0, 1.5, 1007, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("虹村 雪", 1, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "いいよ。\n見られることは運命さ…", 0, "ボクは虹村雪。", 2, 0, 1.4, 1008, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柊杏奈", 1, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "人呼んで「疾風の冥姫」!!", 0, "フッ…聞いて後悔するがいい！", 2, 0, 1.4, 1009, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("姫宮 真歩", 1, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "ほんまおおきにやわ～♪", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 2, 0, 1.5, 1010, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("衣之咲 璃乃", 1, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "ここで会ったが\n100年目～！", 0, "衣之咲璃乃です！", 2, 0, 1.4, 1011, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柏崎 初音", 1, 0, 1, "ち、超能力って…\n何のことかな～？", 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 0, 1.4, 1012, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("美波 鈴奈", 1, 0, 1, "一応カリスマ読モJKやってまっす！", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "ちょす！\n美波鈴奈だよ～♪", 2, 0, 1.4, 1016, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("喜屋武 香織", 1, 0, 1, "東京は遊園地みたいなところさー", 0, "でも、沖縄もとってもいいとこさー", 0, "はいたーい。\n喜屋武香織さー。", 2, 0, 1.4, 1017, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("支倉 伊緒", 1, 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, "イオちゃんって呼んでね。", 0, "支倉伊緒です。", 2, 0, 1.4, 1018, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("茜 ミミ", 1, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ミミをおいてかないでぇ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 0, 1.5, 1020, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("栗林 くるみ", 1, 0, 1, "あの……\nふぇ……", 0, "ふぇぇぇぇぇん……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 0, 1.5, 1021, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("風宮 より", 1, 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, "なんてありがとうございます！", 0, "風宮よりです。\nあああああ！", 2, 0, 1.4, 1022, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("北条 綾音", 1, 0, 1, "おにいちゃんどこいくの？\nえ？", 0, "私こっち行きたいー\nね、早く早くー", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 0, 1.5, 1023, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("天野 すずめ", 1, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "これて何か違う…\nあああすみません！", 0, "わっ…わっ…私、\n天野すずめといいます！", 2, 0, 1.4, 1025, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("倉石 恵理子", 1, 0, 1, "あなたは…運命の……\n伴侶……", 0, "離しませんわ………\n絶対に…!!", 0, "……クスクス…私は\n…倉石恵理子……", 2, 0, 1.4, 1027, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("佐々木 咲恋", 1, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "…そうでしょ？？", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 0, 1.4, 1028, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("桜井 望", 1, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, "あはは、\n私もまだまだだなぁ～", 0, "桜井望だよ！\nよろしくねっ", 2, 0, 1.4, 1029, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("ニノン・ジュベール", 1, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "デケデケデンっ！", 2, 0, 1.4, 1030, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("上喜 しのぶ", 1, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, "おかしいですね……", 0, "上喜しのぶです。\n手元のドクロが父です。", 2, 0, 1.4, 1031, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("野戸まひる", 1, 0, 1, "けんども\nそれには足りないモンが…", 0, "そう、\nオラのボケに突っ込める相方が…！", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 2, 0, 1.5, 1033, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("綾瀬 ゆかり", 1, 0, 1, "ちょっと緊張しちゃって…", 0, "ちょ\nちょっと一杯飲んできます…！", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 0, 1.4, 1034, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("氷川 鏡華", 1, 0, 1, "知らない人とは話しちゃいけないので", 0, "これ以上お話しすることは…\nないです！", 0, "氷川鏡華…です", 2, 0, 1.5, 1036, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("柏崎 栞", 1, 0, 1, "……あ、アラーム。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "柏崎…栞です。", 2, 0, 1.4, 1038, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("双葉 碧", 1, 0, 1, "私、一人も友達がいなくて……", 0, "野に咲く花が、\n唯一の話相手です。", 0, "ふ、双葉碧です。", 2, 0, 1.4, 1040, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("三角 千歌", 1, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "そう思っています。", 0, "三角千歌です。", 2, 0, 1.4, 1042, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("安芸 真琴", 1, 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, "う、疑ってすまなかったな…", 0, "安芸真琴だ。", 2, 0, 1.4, 1043, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("イリヤ・オーンスタイン", 1, 0, 1, "生けとし生ける全ての者よ！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "わらわこそは夜を総べる者！", 2, 0, 1.4, 1044, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("遠見 空花", 1, 0, 1, "ぐふふふふ……はっ！", 0, "ｌク、クウカに何かご用ですか!?", 0, "そこで騎士は妖精を乱暴に……", 2, 0, 1.4, 1045, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("宮坂たまき", 1, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 0, 1.4, 1046, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("大神 美冬", 1, 0, 1, "それでは早速クエストに…", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "大神美冬よ！", 2, 0, 1.4, 1048, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("星野静流", 1, 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "星野静流だよ！", 2, 0, 1.4, 1049, 0, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES ("玉泉美咲", 1, 0, 1, "見ての通りの\nセクシー美少女で", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "アタシは玉泉美咲。", 2, 0, 1.5, 1050, 0, 1);
